import React from 'react';
import { AppBar } from '@material-ui/core';
import './App.css';
import MenuButtons from './MenuButtons.js';


function App() {
  return (
    <div className="App">
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" className={classes.title}>
            News
          </Typography>
        </Toolbar>
      </AppBar>
      <MenuButtons />
    </div>
  );
}

export default App;
